class HtmlCMS
{
    var $path = null;
    function __construct($path) {
        $this->path = $path;
    }
    function add_new($title,$cont)
    {
        if(file_exists("$this->path/$title.htcms") == FALSE)
        {
                $home_settings_file = fopen("$this->path/$title.htcms", "w+") or die("Unable to open file!");
                fwrite($home_settings_file, $cont);
                fclose($home_settings_file);
                return true;
        }
        else
        {
            false;
        }
    }
    function list_all()
    {
        return $files = glob("$this->path/*.htcms");
    }
    function get_by_title($title)
    {
        if(file_exists("$this->path/$title.htcms"))
        {
            return  file_get_contents("$this->path/$title.htcms");
        }
        else
        {
            return '<h1 style="text-align: center;"><br></h1>
            <h1 style="text-align: center;"><img data-filename="exclamation_2.jpg" src="data:image/jpeg;base64," style="width: 25%;">Sorry the content you are looking for is not found.</h1>
            <h2 style=" text-align: center;">It might have been removed.<br></h2>
            <p><br></p>';
        }
    }
}

